import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Sidebar from "./components/nav_bars/Sidebar";
import CreateCompanyComponent from "./components/add_components/CreateCompanyComponent";
import CreateEmployeeComponent from "./components/add_components/CreateEmployeeComponent";
import CreateFlightComponent from "./components/add_components/CreateFlightComponent";
import CreateClientComponent from "./components/add_components/CreateClientComponent";
import SearchEmployeeComponent from "./components/list_components/home/SearchEmployeeComponent";
import SearchFlightComponent from "./components/list_components/home/SearchFlightComponent";
import DepartureFlightComponent from "./components/list_components/flight/DepartureFlightComponent";
import ArrivalFlightsComponent from "./components/list_components/flight/ArrivalFlightsComponent";
import SearchAircraftComponent from "./components/list_components/flight/SearchAircraftComponent";
import SearchCompaniesComponent from "./components/list_components/companies/SearchCompaniesComponent";
import SearchClientsComponent from "./components/list_components/clients/SearchClientsComponent";
import MainPage from "./components/MainPage";
import * as React from "react";
import UpdateFlightComponent from "./components/update_components/UpdateFlightComponent";
import UpdateAircraftComponent from "./components/update_components/UpdateAircraftComponent";
import CreateAircraftComponent from "./components/add_components/CreateAircraftComponent";
import UpdateClientComponent from "./components/update_components/UpdateClientComponent";
import UpdateCompanyComponent from "./components/update_components/UpdateCompanyComponent";
import UpdateEmployeeComponent from "./components/update_components/UpdateEmployeeComponent";
import LoginComponent from "./LoginComponent";

class App extends React.Component {
    constructor(props) {
        super(props);

        this.parentCallback = this.parentCallback.bind(this)
    }

    parentCallback = (childInformation) => {
        console.log(childInformation)
    }

    render() {
        return (
            <Router>
                <Switch>
                    <Route exact path='/' render={(props) => (
                        <LoginComponent parentCallback={this.parentCallback}/>
                    )}/>
                    <Route exact path='/home' component={MainPage}/>
                    <Route exact path='/home/search-for-employee' component={SearchEmployeeComponent}/>
                    <Route path='/home/search-for-flight' exact component={SearchFlightComponent}/>
                    <Route path='/flight/departure-flight' exact component={DepartureFlightComponent}/>
                    <Route path='/flight/arrival-flight' exact component={ArrivalFlightsComponent}/>
                    <Route path='/flight/aircraft' exact component={SearchAircraftComponent}/>
                    <Route path='/clients' exact component={SearchClientsComponent}/>
                    <Route path='/companies' exact component={SearchCompaniesComponent}/>
                    <Route path='/add-new-flight' exact component={CreateFlightComponent}/>
                    <Route path='/add-new-aircraft' exact component={CreateAircraftComponent}/>
                    <Route path='/add-new-employee' exact component={CreateEmployeeComponent}/>
                    <Route path='/add-new-company' exact component={CreateCompanyComponent}/>
                    <Route path='/add-new-client' exact component={CreateClientComponent}/>
                    <Route path='/update-flight/:id' exact component={UpdateFlightComponent}/>
                    <Route path='/update-aircraft/:id' exact component={UpdateAircraftComponent}/>
                    <Route path='/update-client/:id' exact component={UpdateClientComponent}/>
                    <Route path='/update-company/:id' exact component={UpdateCompanyComponent}/>
                    <Route path='/update-employee/:id' exact component={UpdateEmployeeComponent}/>
                </Switch>
            </Router>
        );
    }
}

export default App;
